import React from 'react';
import './App.css';
import styled from 'styled-components'

class App extends React.Component{

  render(){
    const style = {
      backgroundColor: 'green',
      color: 'white',
      border: '1px solid blue',
      padding: '8px',
      cursor: 'pointer',
      }


    return(
        <button style={style}>Click Me</button>
    )

  }

}
export default App
